import ReactDom from "react-dom";
import './index.css';

// ==vars=





function Booklist(){
  return <section className="booklist">{books.map((book)=>{

    return <div>
      <Book key={book.id} {...book} ></Book>
    </div>
  })}</section>;
}

const clickHandler = () => {
  alert('Hello World')
}
const complex = (author) => {
console.log(author)
}
const Book = (props) => {
  const { img, title, author } = props;   
  console.log(props);
  return (
    <section className="booklist">
      <img src={img} alt="" />
      <h3
        onClick={() => {
          alert("Title" + { title });
        }}
      >
        {title}
      </h3>
      <p>{author}</p>
      <button type="button" onMouseOver={clickHandler}>
        Reference
      </button>
      <button type="button" onMouseOver={() => complex(author)}>
        More Complex
      </button>
    </section>
  );
};






ReactDom.render(<Booklist />, document.getElementById("root"));
